import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Header from "./Components/Header";
import GetPlayers from "./Components/GetPlayers";
import AddPlayers from "./Components/AddPlayers";
import DeletePlayers from "./Components/DeletePlayers";
import UpdatePlayers from "./Components/UpdatePlayers";
import Page404 from './Components/Page404';
import Home from "./Components/Home";

const Routes = () => {

    return (
        <div>
            <Router>
                <div>
                    <Header />
                    <div>
                        <Switch>
                            <Route exact path="/" > <Home /> </Route>
                            <Route exact path="/home" > <Home /> </Route>
                            <Route path="/get" > <GetPlayers /></Route>
                            <Route path="/add" > <AddPlayers /></Route>
                            <Route path="/delete" > <DeletePlayers /></Route>
                            <Route path="/update" > <UpdatePlayers /></Route>
                            <Route path="/*"> <Page404 /> </Route>
                            </Switch>
                    </div>

                </div>
            </Router>
        </div>
    );

}
export default Routes;
